func Test_commonChild(t *testing.T) {
	type args struct {
		s1 string
		s2 string
	}
	tests := []struct {
		name string
		args args
		want int32
	}{
		{
			name: "1",
			args: args{"harry", "sally"},
			want: int32(2),
		},
		{
			name: "2",
			args: args{"aa", "bb"},
			want: int32(0),
		},
		{
			name: "3",
			args: args{"SHINCHAN", "NOHARAAA"},
			want: int32(3),
		},
		{
			name: "4",
			args: args{"ABCD", "ABDC"},
			want: int32(3),
		},
		{
			name: "5",
			args: args{"ABCDEF", "FBDAMN"},
			want: int32(2),
		},
		{
			name: "fail",
			args: args{"WEWOUCUIDGCGTRMEZEPXZFEJWISRSBBSYXAYDFEJJDLEBVHHKS", "FDAGCXGKCTKWNECHMRXZWMLRYUCOCZHJRRJBOAJOQJZZVUYXIC"},
			want: int32(15),
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := commonChild(tt.args.s1, tt.args.s2); got != tt.want {
				t.Errorf("commonChild() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_steadyGene(t *testing.T) {
	type args struct {
		gene string
	}
	tests := []struct {
		name string
		args args
		want int32
	}{
		{
			name: "simp",
			args: args{"AAGGTTCC"},
			want: 0,
		},
		{
			name: "simp2",
			args: args{"AGTC"},
			want: 0,
		},
		{
			name: "1",
			args: args{"ACTGAAAG"},
			want: 2,
		},
		{
			name: "2",
			args: args{"GAAATAAA"},
			want: 5,
		},
		{
			name: "5",
			args: args{"TGATGCCGTCCCCTCAACTTGAGTGCTCCTAATGCGTTGC"},
			want: 5,
		},
		{
			name: "6",
			args: args{``},
			want: 288810,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := steadyGene(tt.args.gene); got != tt.want {
				t.Errorf("steadyGene() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_palindromeIndex(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want int32
	}{
		{
			name: "base",
			args: args{"a"},
			want: -1,
		},
		{
			name: "easy",
			args: args{"aba"},
			want: -1,
		},
		{
			name: "e2",
			args: args{"abba"},
			want: -1,
		},
		{
			name: "d1",
			args: args{"abcb"},
			want: 0,
		},
		{
			name: "d2",
			args: args{"abbca"},
			want: 3,
		},
		{
			name: "d3",
			args: args{"abab"},
			want: 0,
		},
		{
			name: "f1",
			args: args{"hgygsvlfcwnswtuhmyaljkqlqjjqlqkjlaymhutwsnwcwflvsgygh"},
			want: 44,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := palindromeIndex(tt.args.s); got != tt.want {
				t.Errorf("palindromeIndex() = %v, want %v", got, tt.want)
			}
		})
	}
}

